cordova.define("com.jiedaibao.hybridopenurl.HybridOpenUrl", function (require, exports, module) {
   var exec = require('cordova/exec');
   module.exports = {
       hybridOpenUrl : function(url, successCallback, errorCallback) {
       exec(
            successCallback,
            errorCallback,
            'HybridOpenUrl',
            'hybridOpenUrl',
            [{
             "url": url
             }]
            );
       }
    }
  }
);
